//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_shake_256s

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/katzenpost/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("91f480fb3545c1ca7ee620b538ba5d41e21c13907543b5e2550a9e5a4214df2ba846aca3b143dd4cc27e81b2c77bef89d0c3f69b5cbcb99c5b4a340ae017e19384738fd4c6719e54d8fb0caa7a3eb3e016293488e307f807ba14c110c1bf829359fec4c9ac8b5e0d6270f095e356f548a164701d593ebe209edb718c29903e77")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("84738fd4c6719e54d8fb0caa7a3eb3e016293488e307f807ba14c110c1bf829359fec4c9ac8b5e0d6270f095e356f548a164701d593ebe209edb718c29903e77")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

  signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
